import React from 'react';

import styles from './Flight.module.scss';

export default function Flight({ flight }) {
  console.log(flight?.links?.webcast);
  return (
    <div>
      <video
        playsInline
        id='video'
        autoPlay={true}
        preload='auto'
        className={styles.video}
        controls='true'
      >
        <source
          src='https://www.youtube.com/watch?v=0a_00nJ_Y88'
          type='video/mp4'
        />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}
